import { Link } from "react-router-dom";
function MainNavigation(){
    return(
        <header>
            <nav>
                <ul>
                    <li><Link to="/">홈으로</Link></li>
                    <li><Link to="/products">제품목록</Link></li>
                </ul>
            </nav>
        </header>
    )
}

export default MainNavigation;
